    const { data } = await axios.get(api, { timeout: 90_000 })

    if (!data?.status) throw "❌ Gagal mengambil audio Spotify"
    const r = data.result
    if (!r?.downloadUrl) throw "❌ Link unduhan tidak tersedia"

    return {
      title: r.title || "-",
      artist: r.artist || "-",
      duration: r.duration || "00:00",
      cover: r.cover || "",
      download: r.downloadUrl
    }
  }

  try {
    await conn.sendMessage(m.chat, { react: { text: "🎧", key: m.key } })

    const url = text.trim()
    const result = await spotdl(url)

